import styled from 'styled-components';
import React from 'react'

const Span = styled('div')`
font-family: 'Monofett', cursive;
font-size:36px;
text-align:center;
color: var(--primary);
`

const Logo = ({ children }) => {
    return <Span>
        {children}
    </Span>
}

export default Logo;
